INSERT INTO `wac_birthday_drama_script` VALUES (/*command_id*/35814065, /*drama_id*/35814, /*command_type*/11, /*param_01*/'107111', /*param_02*/'虽然我很感谢你们的心意，\n但给我庆生没问题吗？\n在外界看来，我这个女人\n离开公会的过程可是很有问题的哦。', /*param_03*/'10', /*param_04*/'1', /*param_05*/'1', /*param_06*/'0', /*param_07*/'0', /*param_08*/'0.5');
