INSERT INTO `wac_birthday_drama_script` VALUES (/*command_id*/35814070, /*drama_id*/35814, /*command_type*/11, /*param_01*/'103711', /*param_02*/'不，到现在为止，我们\n过生日的时候你不是都出现了吗。\n每次都在兴致勃勃地做准备，\n我觉得你早就已经改头换面了。', /*param_03*/'10', /*param_04*/'1', /*param_05*/'1', /*param_06*/'0', /*param_07*/'0', /*param_08*/'0.5');
