INSERT INTO `wac_birthday_drama_script` VALUES (/*command_id*/35814075, /*drama_id*/35814, /*command_type*/11, /*param_01*/'100511', /*param_02*/'而且说到底，克莉丝提娜大婶\n从一开始就有着各种问题了，\n这种事根本没人在意哦！', /*param_03*/'10', /*param_04*/'1', /*param_05*/'1', /*param_06*/'0', /*param_07*/'0', /*param_08*/'0.5');
